import React,{ useState } from 'react'
import './Card.css'


function Card() {
  const [name,setName] = useState('Ayah Imad');
  const [place,setPlace] = useState('Amman / Jordan');
  const [job,setJob] = useState('Web developer');
  const [about,setAbout] = useState('My logo is : Never Give up');

  return (
  <div className="Card">
     <div className='upper-container'>
       <div className='image-container'>
      <img src="https://th.bing.com/th/id/OIP.oxJs-NTwdWE1ezyBOFY9wQHaJR?pid=Api&rs=1" alt=" " height="150px" width="150px" />
      
      </div>
    </div>
    <div className="lower-container">
       <h2>{ name }</h2>
       <small>{ place }</small>
       <small><b>{ job }</b></small>
       <h5>{ about }</h5>
    </div>
  </div> 
  )
}

export default Card
